async (cost, payout) => {
  if (appsmith.store.walletAmount == null || appsmith.store.walletAmount < cost) {
    showModal('Modal2');
    return;
  }
  var newWalletAmount = appsmith.store.walletAmount - cost;
  storeValue('walletAmount', newWalletAmount);
  storeValue('pendingPayout', payout);
  showModal('Modal1');
}

